  return "select gcl.*,ht.construction_team,ht.construction_manager ,ht.consume_price  "
+"from tbl_project_volume gcl ,tbl_labor ht "	
+" where gcl.labor_id =ht.id"	
	}else{
   return 
   "select gcl.*,ht.construction_team,ht.construction_manager ,ht.consume_price  "
+"from tbl_project_volume gcl ,tbl_labor ht "	
+" where gcl.labor_id = ht.id "
     +"and gcl.id=:id"
   }
}

